const Index = () => (
    <Layout>
        <div>
            <h1>Home</h1>

            <img src="/typing.gif" alt="kermit" />
        </div>

        <style jsx>{`
            div {
                height: 90vh;
                background: white;
            }
        `}</style>
    </Layout>
)

export default Index;
